import React from 'react';
import { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } from 'recharts';

function chart() {
    const data = [
        { name: 'Jan', Sales: 4000, Gross: 2400 },
        { name: 'Feb', Sales: 3000, Gross: 1398 },
        { name: 'Mar', Sales: 2000, Gross: 9800 },
        { name: 'Apr', Sales: 2780, Gross: 3908 },
        { name: 'May', Sales: 1890, Gross: 4800 },
        { name: 'Jun', Sales: 2390, Gross: 3800 },
        { name: 'Jul', Sales: 3490, Gross: 4300 },
        { name: 'Aug', Sales: 4000, Gross: 2400 },
        { name: 'Sep', Sales: 3000, Gross: 1398 },
        { name: 'Oct', Sales: 2000, Gross: 9800 },
        { name: 'Nov', Sales: 2780, Gross: 3908 },
        { name: 'Dec', Sales: 1890, Gross: 3222 },
    ];

    return (
        <ResponsiveContainer width="100%" height={300}>
            <LineChart data={data} margin={{ top: 5, right: 300, left: 20, bottom: 5 }}>
                <XAxis dataKey="name" />
                <YAxis />
                <CartesianGrid strokeDasharray="3 3" />
                <Tooltip />
                <Legend />
                <Line type="monotone" dataKey="Sales" stroke="#8884d8" activeDot={{ r: 8 }} />
            </LineChart>
        </ResponsiveContainer>
    );
}
